import "./GameTime.css";

import React from "react";

class GameTime extends React.Component {
    constructor(props){
        super(props)
    }

    render(){
        let classes = this.props.className;
        return (
            <div className="gt-game-time" className={classes}>
                {this.props.value}
            </div>
        );
    }


}

export default GameTime;
